function ({value}, {output1, output2, output3}, {state}) {
  const currentIndex = state.get("currentIndex") || 0;
  const outputs = [output1, output2, output3];
  const nextIndex = (currentIndex + 1) % outputs.length;

  outputs[currentIndex].next(value);
  state.set("currentIndex", nextIndex);
}
